import React, { Component } from "react";
import Weather from "./weather.js";
import { Link, Switch } from "react-router-dom";
class Mainpage extends Component {
  render() {
    return (
      <div>
        <div>
          <Router>
            <div>
              <nav>
                <Link to="./weather">Weather</Link>
              </nav>
            </div>

            <Switch>
              <Route path="/weather">
                <Weather />
              </Route>
            </Switch>
          </Router>
        </div>
      </div>
    );
  }
}
export default Mainpage;
